        body {
            margin: 0;
            width: 100%;
            height: 100%

            font-family: arial, sans-serif
        }

        textarea,
        select {

            opacity: 0;
            overflow: hidden;
            position: relative;

            animation: a-lb 20s 3s linear forwards;
            background-color: #db4437;
            content: '';
            display: block;
            height: 100%;
            position: absolute;
            transform: translateX(-300px);
            width: 100%
        }

        @keyframes a-lb {
            0% {
                transform: translateX(-300px)
            }

            5% {
                transform: translateX(-240px)
            }

            15% {
                transform: translateX(-30px)
            }

            25% {
                transform: translateX(-30px)
            }

            30% {
                transform: translateX(-20px)
            }

            45% {
                transform: translateX(-20px)
            }

            50% {
                transform: translateX(-15px)
            }

            65% {
                transform: translateX(-15px)
            }

                transform: translateX(-10px)

            95% {

                transform: translateY(-16px)

                transform: none
            }

            89% {
                animation-timing-function: cubic-bezier(.8, 0, 1, 1);
                transform: translateY(-5px)
            }

            100% {
                transform: none
            }
        }

        @keyframes a-ef {
            24% {
                animation-timing-function: cubic-bezier(.8, 0, .6, 1);

            }

            83% {
                animation-timing-function: cubic-bezier(.8, 0, .84, 1);
                opacity: .05
            }

            100% {
                opacity: 0
            }
        }

        @keyframes a-es {
            24% {
                animation-timing-function: cubic-bezier(.8, 0, .6, 1);
                transform: rotate(-25deg)
            }

            52% {
                animation-timing-function: cubic-bezier(.63, 0, .2, 1);

            0% {

                opacity: 1;
                transform: scale(.8)
            }

            50% {
                animation-timing-function: linear;
                transform: scale(.96)
            }
        }

        @keyframes kf-c {
            25% {
                animation-timing-function: cubic-bezier(.17, .98, .38, 1);
                transform: scale(1.1)
            }

            to {
                transform: none
            }
        }

        @keyframes kf-s {
            35% {

            }

            }
        }

        @keyframes kf-v {
            66% {
                animation-timing-function: cubic-bezier(.3, 0, .83, .83);
                opacity: 1
            }
        }

        .invfr {
            position: absolute;
            left: 0;
            top: 0;
            z-index: -1;
            width: 0;
            height: 0;
            border: 0
        }

        .msgb {
            position: absolute;
            right: 0;
            font-size: 12px;
            font-weight: normal;
            color: #000;
            padding: 20px
        }
